      <text id="9" justification="0" size="4" underlined="false">
        <text>Scrivere una classe java Squadra che ha come attributo un nome e un array di Giocatore dell&apos;esercizio precedente ma con in più l&apos;attributo ruolo che assume i valori di una enumerazione (BATTITORE, PRIMA BASE,…)
Il costruttore crea una classe con un array di N_MAX_GIOCATORI vuoto. La classe possiede anche i seguenti metodi:
• +addGiocatore(Giocatore g)
• +void setPunteggio(String nome, double valore)
• +double getPunteggioMedio() della squadra
• +passatoAnno() incrementa tutte le età
• +String toString()</text>
